    "Showing {currentItemRange} out of {totalItemsCount}, filtered by {assetType}, sorted by {sortName} descending": "{totalItemsCount} \u092e\u0947\u0902 \u0938\u0947 {currentItemRange} \u0926\u093f\u0916\u093e \u0930\u0939\u093e \u0939\u0948, {assetType} \u0926\u094d\u0935\u093e\u0930\u093e \u092b\u093c\u093f\u0932\u094d\u091f\u0930 \u0915\u093f\u092f\u093e \u0917\u092f\u093e \u0939\u0948, {sortName} \u0905\u0935\u0930\u094b\u0939\u0940 \u0915\u094d\u0930\u092e \u092e\u0947\u0902 \u0915\u094d\u0930\u092e\u092c\u0926\u094d\u0927 \u0915\u093f\u092f\u093e \u0917\u092f\u093e \u0939\u0948",
    "Showing {currentItemRange} out of {totalItemsCount}, sorted by {sortName} ascending": "{totalItemsCount} \u092e\u0947\u0902 \u0938\u0947 {currentItemRange} \u0926\u093f\u0916\u093e \u0930\u0939\u093e \u0939\u0948, {sortName} \u0915\u0947 \u0905\u0928\u0941\u0938\u093e\u0930 \u0906\u0930\u094b\u0939\u0940 \u0915\u094d\u0930\u092e \u092e\u0947\u0902 \u0915\u094d\u0930\u092e\u092c\u0926\u094d\u0927 \u0915\u093f\u092f\u093e \u0917\u092f\u093e \u0939\u0948",
    "Showing {currentItemRange} out of {totalItemsCount}, sorted by {sortName} descending": "{totalItemsCount} \u092e\u0947\u0902 \u0938\u0947 {currentItemRange} \u0926\u093f\u0916\u093e\u092f\u093e \u091c\u093e \u0930\u0939\u093e \u0939\u0948, \u091c\u093f\u0938\u0947 \u0905\u0935\u0930\u094b\u0939\u0940 \u0915\u094d\u0930\u092e \u092e\u0947\u0902 {sortName} \u0915\u0947 \u0905\u0928\u0941\u0938\u093e\u0930 \u0915\u094d\u0930\u092e\u092c\u0926\u094d\u0927 \u0915\u093f\u092f\u093e \u0917\u092f\u093e \u0939\u0948",
    "Sign in to {platform} so we can help you better.": "{platform} \u092e\u0947\u0902 \u0938\u093e\u0907\u0928 \u0907\u0928 \u0915\u0930\u0947\u0902 \u0924\u093e\u0915\u093f \u0939\u092e \u0906\u092a\u0915\u0940 \u092c\u0947\u0939\u0924\u0930 \u092e\u0926\u0926 \u0915\u0930 \u0938\u0915\u0947\u0902\u0964",
    "Signatory field(s) has invalid data.": "\u0939\u0938\u094d\u0924\u093e\u0915\u094d\u0937\u0930 \u0915\u094d\u0937\u0947\u0924\u094d\u0930 (s) \u092e\u0947\u0902 \u0905\u092e\u093e\u0928\u094d\u092f \u0921\u0947\u091f\u093e \u0939\u0948\u0964",
    "Sorry, there was an error parsing the subtitles that you uploaded. Please check the format and try again.": "\u0915\u094d\u0937\u092e\u093e \u0915\u0930\u0947\u0902, \u0906\u092a\u0915\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u0905\u092a\u0932\u094b\u0921 \u0915\u093f\u090f \u0917\u090f \u0909\u092a\u0936\u0940\u0930\u094d\u0937\u0915 \u0915\u094b \u092a\u093e\u0930\u094d\u0938 \u0915\u0930\u0928\u0947 \u092e\u0947\u0902 \u0924\u094d\u0930\u0941\u091f\u093f \u0939\u0941\u0908 \u0925\u0940\u0964 \u0915\u0943\u092a\u092f\u093e \u092a\u094d\u0930\u093e\u0930\u0942\u092a \u0915\u0940 \u091c\u093e\u0901\u091a \u0915\u0930\u0947\u0902 \u0914\u0930 \u092a\u0941\u0928\u0903 \u092a\u094d\u0930\u092f\u093e\u0938 \u0915\u0930\u0947\u0902\u0964",
    "Staff": "\u0915\u0930\u094d\u092e\u091a\u093e\u0930\u0940",
