    "Studio's having trouble saving your work": "\u0938\u094d\u091f\u0942\u0921\u093f\u092f\u094b \u0915\u094b \u0906\u092a\u0915\u0947 \u0915\u093e\u092e \u0915\u094b \u092c\u091a\u093e\u0928\u0947 \u092e\u0947\u0902 \u092a\u0930\u0947\u0936\u093e\u0928\u0940 \u0939\u094b \u0930\u0939\u0940 \u0939\u0948",
    "Submitted": "\u092a\u094d\u0930\u0938\u094d\u0924\u0941\u0924 \u0915\u0930 \u0926\u093f\u092f\u093e \u0917\u092f\u093e",
    "Subsections": "\u0909\u092a\u0916\u0902\u0921",
    "Success! \"{displayName}\" has been moved.": "\u0938\u092b\u0932\u0924\u093e! \"{displayName}\" \u0915\u094b \u0938\u094d\u0925\u093e\u0928\u093e\u0902\u0924\u0930\u093f\u0924 \u0915\u0930 \u0926\u093f\u092f\u093e \u0917\u092f\u093e \u0939\u0948\u0964",
