    "You have selected an action, but you haven't saved your changes to individual fields yet. Please click OK to save. You'll need to re-run the action.": "\u0906\u092a \u0928\u0947 \u0915\u093e\u0930\u094d\u0930\u0935\u093e\u0908 \u0924\u094b \u091a\u0941\u0928\u0940 \u0939\u0948\u0902, \u092a\u0930 \u0938\u094d\u0935\u0924\u0902\u0924\u094d\u0930 \u0938\u092e\u094d\u092a\u093e\u0926\u0928\u0915\u094d\u0937\u092e \u0915\u094d\u0937\u0947\u0924\u094d\u0930/\u0938\u094d\u0924\u092e\u094d\u092d \u092e\u0947\u0902 \u0915\u093f\u092f\u0947 \u0939\u0941\u090f \u092c\u0926\u0932 \u0905\u092d\u0940 \u0938\u0941\u0930\u0915\u094d\u0937\u093f\u0924 \u0928\u0939\u0940\u0902 \u0915\u093f\u092f\u0947 \u0939\u0948\u0902| \u0909\u0928\u094d\u0939\u0947\u0902 \u0938\u0941\u0930\u0915\u094d\u0937\u093f\u0924 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0915\u0943\u092a\u092f\u093e '\u0913\u0915\u0947' \u0915\u094d\u0932\u093f\u0915 \u0915\u0930\u0947 | \u0906\u092a \u0915\u094b \u091a\u0941\u0928\u0940 \u0939\u0941\u0908 \u0915\u093e\u0930\u094d\u0930\u0935\u093e\u0908 \u0926\u094b\u092c\u093e\u0930\u093e \u091a\u0932\u093e\u0928\u0940 \u0939\u094b\u0917\u0940 |",
    "You have set your language to {beta_language}, which is currently not fully translated. You can help us translate this language fully by joining the Transifex community and adding translations from English for learners that speak {beta_language}.": "\u0906\u092a\u0928\u0947 \u0905\u092a\u0928\u0940 \u092d\u093e\u0937\u093e \u0915\u094b {beta_language} \u092a\u0930 \u0938\u0947\u091f \u0915\u093f\u092f\u093e \u0939\u0948, \u091c\u094b \u0935\u0930\u094d\u0924\u092e\u093e\u0928 \u092e\u0947\u0902 \u092a\u0942\u0930\u0940 \u0924\u0930\u0939 \u0938\u0947 \u0905\u0928\u0941\u0935\u093e\u0926\u093f\u0924 \u0928\u0939\u0940\u0902 \u0939\u0948\u0964 \u0906\u092a \u091f\u094d\u0930\u093e\u0902\u0938\u093f\u092b\u093c\u0947\u0915\u094d\u0938 \u0938\u092e\u0941\u0926\u093e\u092f \u092e\u0947\u0902 \u0936\u093e\u092e\u093f\u0932 \u0939\u094b\u0915\u0930 \u0914\u0930 {beta_language} \u092c\u094b\u0932\u0928\u0947 \u0935\u093e\u0932\u0947 \u0936\u093f\u0915\u094d\u0937\u093e\u0930\u094d\u0925\u093f\u092f\u094b\u0902 \u0915\u0947 \u0932\u093f\u090f \u0905\u0902\u0917\u094d\u0930\u0947\u091c\u0940 \u0938\u0947 \u0905\u0928\u0941\u0935\u093e\u0926 \u091c\u094b\u0921\u093c\u0915\u0930 \u0907\u0938 \u092d\u093e\u0937\u093e \u0915\u093e \u092a\u0942\u0930\u094d\u0923 \u0905\u0928\u0941\u0935\u093e\u0926 \u0915\u0930\u0928\u0947 \u092e\u0947\u0902 \u0939\u092e\u093e\u0930\u0940 \u0938\u0939\u093e\u092f\u0924\u093e \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902\u0964",
